import React from 'react'
import { pricing } from '../global/Data'

function Pricing() {
    return (
        <section
            className="my-[30px] lg:mt-[100px]"
            data-aos='fade-right'
            data-aos-delay='400'
        >
            <div className='container mx-auto'>
                <div className='flex flex-col justify-center items-center'>
                    {pricing.map((item, idx) => {
                        return (
                            <div key={idx} className='flex flex-col items-center justify-between h-[600px] bg-red-200 border border-black mb-10 p-5'>
                                {/* image */}
                                <img src={item.img} alt="" />
                                <div className='flex-1'>
                                    <div className='font-bold text-center mt-10 mb-5'>
                                        {item.title}
                                    </div>
                                    <div className='flex flex-col'>
                                        {item.content.map((val, idx) => {
                                            return (
                                                <div className='flex flex-row mb-4'>
                                                    <img src={item.icon} alt="" />
                                                    <div className='text-gray-700'>
                                                        {val}
                                                    </div>
                                                </div>

                                            )
                                        })}

                                    </div>
                                </div>
                                <div className=''>
                                    <div className='font-bold'>
                                        {item.price}
                                    </div>
                                    <div>
                                        <button className='border border-red-900 px-5 py-2 rounded-full'>
                                            Select
                                        </button>
                                    </div>
                                </div>
                            </div>
                        )
                    })}
                </div>
            </div>
        </section>
    )
}

export default Pricing
